<h4>
Description
</h4>
<p>UL16-binding protein 2 (<a href="https://www.uniprot.org/uniprot/Q9BZM5">ULBP2</a>). Binds and activates the KLRK1/NKG2D receptor, mediating natural killer cell cytotoxicity.</p>
<p><br></p>

</h4>
